import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ScrollToTop from "./utils/scrollToTop";
import logo from "./images/humana-logo.svg";
import Home from "./components/Home";
import AdventureDetail from "./components/AdventureDetail";
import { Link } from "react-router-dom";
import "./App.scss";
import pq from "../src/api/fetchPQ";
import aemHeadlessClient from "../src/api/aemHeadlessClient";
import Hero from "../src/components/Hero"
import Text from "../src/components/Text"
//import React, { useState } from 'react';

function App() {
  const [data, setData] = useState(0);

  async function fetchData() {
  const persistentQuery = "humana-sample-tenant/AllPages"
  const response = await aemHeadlessClient.runPersistedQuery("humana-sample-tenant/AllPages");

  // The GraphQL data is stored on the response's data field
   setData(response?.data);


  }
  fetchData();
  //console.log(data?.pageList?.items[0])
  return (
    <Router>
      <ScrollToTop />
      <div className="App">
        <header>
        <Link to={"/"}>
          <img src={logo} className="logo" alt="WKND Logo"/>
        </Link>        
        <hr />
        </header>
        {
          data?.pageList?.items[0].components.map(
            (val)=>{
              if(val._typename=='Hero'){
                return <Hero></Hero>
              }
              else{
                return <Text></Text>
              }
            }
          )
        }
        {/* <Routes>
          <Route path='/adventure/:slug' element={<AdventureDetail />}/>
          <Route path="/" element={<Home/>}/>
        </Routes> */}
      </div>
    </Router>
  );
}

export default App;
